import Card from "./Card"

function details() {
    const [details,setDetails] = useState([])

const getDetails = async() => {
    let response = await fetch("http://localhost:5000/")
    let toJSON = response.json()
    setDetails(toJSON)
}

useEffect(()=>{
getDetails()
},[])


  return (
    <div>
        {
            details.map((item) => {
                return(
                    <>
                    <Card data={item}/>
                    </>
                )
            })
        }
    </div>
  )
}

export default details
